import React from "react";
import { delayUnmounting } from "../utils";

function Menu(props) {
  return (
  <div className="Menu">
    <ul>
      <li onClick={props.close}>Work</li>
      <li onClick={props.close}>About</li>
      <li onClick={props.close}>Contact</li>
      <li onClick={props.close}>Interest</li>
    </ul>
  </div>
  );
}

export default delayUnmounting(Menu);
